import React from "react";
import { Card } from "react-bootstrap";

const FlightInfo = () => {
  // Example flight information
  const flight = {
    flightNumber: "AA123",
    departure: "New York (JFK) - 10:00 AM",
    arrival: "Los Angeles (LAX) - 1:00 PM",
    status: "On Time",
  };

  return (
    <div>
      <h2>Real-time Flight Information</h2>
      <Card className="mb-3">
        <Card.Body>
          <Card.Title>Flight {flight.flightNumber}</Card.Title>
          <Card.Text>Departure: {flight.departure}</Card.Text>
          <Card.Text>Arrival: {flight.arrival}</Card.Text>
          <Card.Text>
            <small className="text-muted">Status: {flight.status}</small>
          </Card.Text>
        </Card.Body>
      </Card>
    </div>
  );
};

export default FlightInfo;
